The Northwest Branch Saint John River (French: Rivière Noire Nord-Ouest) is a 15.5-mile-long (24.9 km) river primarily in Aroostook County, Maine. Its origin (46°42′04″N 69°59′55″W﻿ / ﻿46.7012°N 69.9987°W) is Frontier Lake (Quebec-Maine) in Quebec, Canada. After crossing the Canada–United States border, the Northwest Branch runs south close to the border until it picks up its tributary, the Daaquam River, which also flows out of Canada. The Northwest Branch then runs generally eastward to its confluence with the Southwest Branch to form the Saint John River. His current flowing in: 
*  Montmagny Regional County Municipality (RCM): municipality of Lac-Frontière, Quebec; 
*  Aroostook County: (township T11 R17 WELS), in the state of Maine; 
*  Somerset County, Maine: (township T10 R17 WELS), in the state of Maine. On the Canadian side, the road 283 runs along the Canada-US border on 6.4 kilometres (4.0 mi) and crosses the "Northwest Branch Saint John River" at the South East side of the Frontier Lake (Quebec-Maine). On the US side, a road from Frontier Lake (Quebec-Maine) moves Eastward through the mountains. In addition, a road runs on the North bank on a river segment, downstream of the confluence of the Daaquam River and serves the township T11 R17 WELS in the North Maine Woods.

North Keltma (Russian: Северная Кельтма) is a river in Komi Republic, Russia, a left tributary of the Vychegda River. It is 155 kilometres (96 mi) long, with a drainage basin of 7,960 square kilometres (3,070 sq mi). It starts in the extreme south of the Komi Republic, near the border with Perm Krai. It flows into the Vychegda near the settlement of Kerchomya. There are many swamps along the river. The river freezes in the early November and stays under the ice until early May.It is connected with the South Keltma River by the Northern Catherine Canal, which was constructed in 1785–1822 but operated for only 16 years. Main tributaries: 
* Left: Okos, Voch, Vol; 
* Right: El, Michael
